$(document).ready(function () {
	
	$('.wrap_slider-items').slick({

		arrows: false,
		infinite: false,
		dots: true

	});

	$('.wrap_slider .wrap_slider-left').on('click', function() {
		$('.wrap_slider-items').slick('slickPrev');
	});

	$('.wrap_slider .wrap_slider-right').on('click', function() {
		$('.wrap_slider-items').slick('slickNext');
	});

	$('.product_slider').slick({
		arrows: false,
		infinite: false,
		dots: true
	})

	$('.product_nav.nav_prev').on('click', function() {
		$('.product_slider').slick('slickPrev');
	});

	$('.product_nav.nav_next').on('click', function() {
		$('.product_slider').slick('slickNext');
	});

	$('.wrap_col-items').slick({
		arrows: false,
		infinite: false,
		dots: false,
		slidesToShow: 3,
		slidesToScroll: 1,

		responsive: [
			{
				breakpoint: 767,
				settings: {
					slidesToShow: 2
				}
			},
			{
				breakpoint: 480,
				settings: {
					slidesToShow: 1
				}
			}
		]

	});

	$('.wrap_col .wrap_slider-left').on('click', function() {
		$('.wrap_col-items').slick('slickPrev');
	});

	$('.wrap_col .wrap_slider-right').on('click', function() {
		$('.wrap_col-items').slick('slickNext');
	});

	// Active menu

	$('.header_burger').click(function() {

		// $('.menu_small').toggle(0, function() {
		// 	$(this).css('z-index', '100');
		// }, function() {
		// 	$(this).css('z-index', '');
		// });

		$('body').toggleClass('open');

		$('.page_header').toggleClass('static');

		if($('body').find('.wrap_auth-block')) {
			$('.wrap_auth-block').toggleClass('z_index-fade');
		}

		$('.header_burger__top, .header_burger__bottom ').toggleClass('active');

		$('.fish_mobile, .menu_fish').toggleClass('fish_active');

		$('.header_logo, .header_right, .page_header').toggleClass('z-index-max');

		$('.menu_small').toggleClass('menu_small-hide');

		$('.menu_small').toggleClass('z-index');

		$('.menu_small').toggleClass(function() {
			if($(this).parent().is('.menu_small-hide')) {
				return 'fade-up-enter-active fadeup-enter-to';
			} else {
				return 'fade-up-leave-active fadeup-enter-to'
			}
		});

		
	});

	// Delete item shop

	$('.delete_arrow').click(function() {
		$('body').addClass('open');
		$('.modal').toggleClass('modal_active');
	});

	$('.modal_close, #modal_close').click(function() {
		$('body').removeClass('open');
		$('.modal').removeClass('modal_active');
	});

	// Active mobile menu shop

	$('.menu_header-button').click(function() {
		$('.mobile_menu').toggleClass('mobile_menu-active');
	});

	// Tabs

		$(".wrap_auth-block .tab").click(function() {
			$(this)
			.addClass('active').siblings().removeClass('active')
			.closest('.wrap_auth-block').find('.auth_block-content').removeClass('active').eq($(this).index()).addClass('active');
		});

	$('.donate_moneyButton').click(function() {
		$(this).addClass('m-active').siblings().removeClass('m-active');
		$('input#name').val($(this).attr('data-price'));
	});

	$(function() {
    	$('img.lazy').lazyload();
	});

	$('.scrollbar-inner').scrollbar();

	$('.orders_open').click(function() {
		$(this).toggleClass('m-active');
		$(this).closest('.orders_header').toggleClass('m-active');
		$(this).closest('.order_item').find('.order_item_products').toggleClass('m-active');
	});


	// Toggle slider items

	// $('.wrap_col-item').hover(function() {
	// 	let item_img = $(this).find('.col_item-img');
	// 	item_img.toggle(0, function() {
	// 		$(this).attr('src', $(this).attr('data-open'));
	// 	}, function() {
	// 		$(this).attr('data-open', $(this).attr('src'));
	// 	});
	// });
});